import React from 'react';
import { motion } from 'framer-motion';
import { CodeBracketIcon, ClipboardDocumentCheckIcon, AcademicCapIcon, SparklesIcon } from '@heroicons/react/24/outline';

const cards = [
  {
    title: '100 Days of Coding',
    desc: 'Daily coding challenges to sharpen your skills.',
    icon: CodeBracketIcon,
    color: 'from-purple-200/80 to-purple-100/80',
  },
  {
    title: 'Mock Interviews',
    desc: 'Practice with real interview questions and get feedback.',
    icon: ClipboardDocumentCheckIcon,
    color: 'from-purple-100/80 to-purple-200/80',
  },
  {
    title: 'Interview Prep',
    desc: '5-day intensive interview preparation bootcamp.',
    icon: AcademicCapIcon,
    color: 'from-purple-50/80 to-purple-100/80',
  },
  {
    title: 'Coding Sprints',
    desc: 'Participate in timed sprints and improve your speed.',
    icon: SparklesIcon,
    color: 'from-purple-100/80 to-purple-300/80',
  },
];

const Practice = () => (
  <div className="max-w-5xl mx-auto py-12 px-4">
    <h1 className="text-3xl font-bold text-purple-900 mb-6">Practice</h1>
    <motion.div
      className="grid grid-cols-1 md:grid-cols-2 gap-6"
      initial="hidden"
      animate="visible"
    >
      {cards.map((card, i) => (
        <motion.div
          key={card.title}
          initial={{ opacity: 0, y: 30 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ delay: i * 0.15 }}
          whileHover={{ scale: 1.04 }}
          className={`glassmorphism bg-gradient-to-br ${card.color} rounded-xl shadow-xl p-6 flex flex-col items-center`}
        >
          <card.icon className="h-10 w-10 text-purple-600 mb-3 animate-bounce" />
          <h2 className="font-semibold text-purple-900 mb-2">{card.title}</h2>
          <p className="text-purple-700 text-sm text-center">{card.desc}</p>
        </motion.div>
      ))}
    </motion.div>
  </div>
);

export default Practice;
